industry = {}

def get_industry(name, item, level):
    if "childList" not in item or level == 2:
        industry[name + "-" + item["name"]] = item["value"]
    else:
        if len(name) == 0:
            name = item["name"]
        else:
            name = name + "-" + item["name"]
        for it in item["childList"]:
            get_industry(name, it, level + 1)
